"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[3382],{9926:(s,a,o)=>{o.r(a),o.d(a,{assets:()=>l,contentTitle:()=>t,default:()=>m,frontMatter:()=>e,metadata:()=>r,toc:()=>c});var n=o(4848),i=o(8453);const e={title:"Como configurar o Facity Impressor?"},t=void 0,r={id:"impressoras/como-configurar-o-facity-impressor-",title:"Como configurar o Facity Impressor?",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/impressoras/como-configurar-o-facity-impressor-.mdx",sourceDirName:"impressoras",slug:"/impressoras/como-configurar-o-facity-impressor-",permalink:"/docs/impressoras/como-configurar-o-facity-impressor-",draft:!1,unlisted:!1,tags:[],version:"current",frontMatter:{title:"Como configurar o Facity Impressor?"},sidebar:"tutorialSidebar",previous:{title:"Novos atalhos do teclado no Sistema Facity",permalink:"/docs/configuracoes/novos-atalhos-do-teclado-no-sistema-facity"},next:{title:"Como vincular impressoras de produ\xe7\xe3o na se\xe7\xe3o/categoria?",permalink:"/docs/impressoras/como-vincular-impressoras-de-producao-na-secao-categoria-"}},l={},c=[];function g(s){return(0,n.jsx)(n.Fragment,{children:(0,n.jsx)(n.Fragment,{children:(0,n.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p></p>\n\n\n\n<p class="has-small-font-size">Ap\xf3s baixar e instalar o <strong>Sistema Facity</strong>, siga estas etapas para configurar o Impressor:</p>\n\n\n\n<p>Se precisar de ajuda com a instala\xe7\xe3o, consulte o tutorial completo:</p>\n\n\n\n<p><strong>Link:</strong> <a href="https://blog.facity.com.br/como-baixar-e-instalar-o-sistema-facity/" data-type="URL" data-id="https://blog.facity.com.br/como-baixar-e-instalar-o-sistema-facity/">https://blog.facity.com.br/como-baixar-e-instalar-o-sistema-facity/</a></p>\n\n\n\n<p></p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 1:</strong><br>Abra o programa <strong>&#8220;Facity Impressor&#8221; </strong>na \xe1rea de trabalho.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/3edit.png" alt="" class="wp-image-1622" width="871" height="487" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 2:</strong><br>Clique em <strong>&#8220;Configurar Conex\xe3o&#8221;</strong>.</p>\n\n\n\n<p></p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/4edit.png" alt="" class="wp-image-1623" width="880" height="633" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 3:</strong><br>Selecione <strong>&#8220;Online&#8221;</strong> e clique em <strong>&#8220;Login&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="894" height="638" src="https://blog.facity.com.br/wp-content/uploads/2024/05/5edit.png" alt="" class="wp-image-1625" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 4:</strong><br>Insira as informa\xe7\xf5es solicitadas:</p>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Nome da empresa (sem espa\xe7os e em min\xfasculas)</li><li>Usu\xe1rio</li><li>Senha</li><li>Clique em <strong>&#8220;Logar&#8221;</strong></li></ul>\n\n\n\n<p class="has-small-font-size"><em><strong>Nota: </strong>Se n\xe3o tiver as informa\xe7\xf5es de login, contate o <strong>Suporte Facity.</strong></em></p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="902" height="623" src="https://blog.facity.com.br/wp-content/uploads/2024/05/6edit.png" alt="" class="wp-image-1626" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 5:</strong><br>V\xe1 em<strong> &#8220;Configura\xe7\xf5es Gerais&#8221;</strong> e clique em <strong>&#8220;Buscar do Administrativo&#8221;</strong>. Verifique as informa\xe7\xf5es e clique em<strong> &#8220;Salvar&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/7edit.png" alt="" class="wp-image-1627" width="902" height="625" /></figure>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/8edit.png" alt="" class="wp-image-1628" width="905" height="739" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 6:</strong><br>Configurar a Impressora de Terminal:</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/impressoradeterminaledit.png" alt="" class="wp-image-1632" width="911" height="542" /></figure>\n\n\n\n<ol class="has-small-font-size wp-block-list"><li>Clique em <strong>&#8220;Impressora de Terminal&#8221;</strong>.</li><li>Selecione o Terminal.</li><li>Escolha a impressora na lista.</li><li>Selecione o modelo e marque <strong>&#8220;negrito&#8221; </strong>e <strong>&#8220;cortar&#8221;</strong>.</li><li>Clique em &#8220;<strong>Adicionar&#8221;</strong> e salve as configura\xe7\xf5es.</li></ol>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/impressoradeterminalconfedit-1.png" alt="" class="wp-image-1633" width="923" height="605" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 7:</strong><br>Configurar a Impressora de Produ\xe7\xe3o:</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/impressoradeproducaoedit.png" alt="" class="wp-image-1634" width="933" height="586" /></figure>\n\n\n\n<ol class="has-small-font-size wp-block-list"><li>Clique em <strong>&#8220;Impressoras de Produ\xe7\xe3o&#8221;</strong>.</li><li>Selecione o Terminal.</li><li>Escolha a impressora na lista.</li><li>Selecione o modelo e marque <strong>&#8220;negrito&#8221;</strong> e<strong> &#8220;cortar&#8221;</strong>.</li><li>Clique em <strong>&#8220;Adicionar&#8221;</strong> e salve as configura\xe7\xf5es.</li></ol>\n\n\n\n<p class="has-small-font-size"><em><strong>Nota:</strong> O processo \xe9 o mesmo para ambas as impressoras, variando conforme o modelo.</em></p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/impressoradeproducaoconfedit.png" alt="" class="wp-image-1635" width="944" height="540" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 8:</strong><br>Clique em <strong>&#8220;Iniciar Servidor&#8221; </strong>para come\xe7ar a usar o impressor.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2024/05/iniciarimpressoredit.png" alt="" class="wp-image-1636" width="951" height="618" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Finalizando a Configura\xe7\xe3o:</strong></p>\n\n\n\n<ol class="has-small-font-size wp-block-list"><li>Teste todas as impressoras configuradas para garantir que est\xe3o imprimindo corretamente.</li><li>Se houver problemas, revise as configura\xe7\xf5es ou entre em <strong>contato</strong> com o <strong>Suporte Facity.</strong></li></ol>\n\n\n\n<p class="has-small-font-size"><strong>Dicas Adicionais:</strong></p>\n\n\n\n<ul class="has-small-font-size wp-block-list"><li>Mantenha os drivers das impressoras atualizados.</li><li>Realize manuten\xe7\xf5es peri\xf3dicas nas impressoras para evitar falhas.</li></ul>\n\n\n\n<p></p>\n\n\n\n<p class="has-small-font-size">Com esses passos, seu <strong>Facity Impressor</strong> estar\xe1 configurado e pronto para uso, garantindo efici\xeancia e precis\xe3o nas suas impress\xf5es.</p>\n\n'}})})})}function m(s={}){const{wrapper:a}={...(0,i.R)(),...s.components};return a?(0,n.jsx)(a,{...s,children:(0,n.jsx)(g,{...s})}):g()}},8453:(s,a,o)=>{o.d(a,{R:()=>t,x:()=>r});var n=o(6540);const i={},e=n.createContext(i);function t(s){const a=n.useContext(e);return n.useMemo((function(){return"function"==typeof s?s(a):{...a,...s}}),[a,s])}function r(s){let a;return a=s.disableParentContext?"function"==typeof s.components?s.components(i):s.components||i:t(s.components),n.createElement(e.Provider,{value:a},s.children)}}}]);